package nCountServer;

import java.io.IOException;

import nCountServer.Stopwatch;

public class SocketHandler 
{
	private static Stopwatch stp;
	
	public static void main(String[] args) 
	{
		stp = new Stopwatch();
		initAssets();
		Server listener;
		ProbeServer probelistener;
		try
		{
			listener = new Server(stp);
			new Thread(new Runnable() 
			{
			    public void run() 
			    {
			        listener.run();
			    }
			}).start();
		} 
		catch (IOException e) 
		{
			Chocolat.println(e.toString());
		}
		
		try
		{
			probelistener = new ProbeServer(stp);
			new Thread(new Runnable() 
			{
			    public void run() 
			    {
			        probelistener.run();
			    }
			}).start();
		} 
		catch (IOException e) 
		{
			Chocolat.println(e.toString());
		}
		
	}
	
	public static void initAssets()
	{
		Chocolat.println("[" + stp.elapsedTime() + "] Initializing webserver assets...");
		DataStore.FourO404 = "data:image/jpeg;base64,";
		DataStore.COUNT = new String[10];
		DataStore.COUNT[0] = "data:image/gif;base64,";
		DataStore.COUNT[1] = "data:image/gif;base64,";	
		DataStore.COUNT[2] = "data:image/gif;base64,";
		DataStore.COUNT[3] = "data:image/gif;base64,";
		DataStore.COUNT[4] = "data:image/gif;base64,";
		DataStore.COUNT[5] = "data:image/gif;base64,";
		DataStore.COUNT[6] = "data:image/gif;base64,";
		DataStore.COUNT[7] = "data:image/gif;base64,";
		DataStore.COUNT[8] = "data:image/gif;base64,";
		DataStore.COUNT[9] = "data:image/gif;base64,";
		new Thread(new CounterUpdatorThread()).start();
		Chocolat.println("[" + stp.elapsedTime() + "] Initialized webserver assets.");	
	}
}
